import React, { useState } from 'react';
import classes from './FiveSliders.module.css';
import PersonalSlider from '../Slider/Slider';

const FiveSliders = ({ first, second, third, fourth, fifth, onValues }) => {
	const valuesH = (value, id) => {
		console.log('in FiveSliders Component');
		console.log(value, id);
		onValues(value, id);
	};

	return (
		<section className={classes['five-sliders']}>
			<PersonalSlider
				title={first.title}
				id={first.id}
				value={first.value}
				onChange={valuesH}
			/>
			<PersonalSlider
				title={second.title}
				id={second.id}
				value={second.value}
				onChange={valuesH}
			/>
			<PersonalSlider
				title={third.title}
				id={third.id}
				value={third.value}
				onChange={valuesH}
			/>
			<PersonalSlider
				title={fourth.title}
				id={fourth.id}
				value={fourth.value}
				onChange={valuesH}
			/>
			<PersonalSlider
				title={fifth.title}
				id={fifth.id}
				value={fifth.value}
				onChange={valuesH}
			/>
		</section>
	);
};

export default FiveSliders;
